import React from 'react';

import '../scss/site.scss';

import * as f from '../functions.js';

class Site extends React.Component {
  render() {
    return (
      <div className='site'>
        <div className='site-preview'>
          <img src='https://cdn.ifnulltrue.com/favicons/if-null-true.png' />
          <div>
            <span>{this.props.name}</span>
          </div>
        </div>
        <div className='site-info'>
          <span className='site-info-title'>{this.props.name}</span>
          <span className='site-info-devs'>Developed by {f.listToString(this.props.developers)}</span>
          <span className='site-info-heading'>Versions:</span>
          <table></table>
        </div>
      </div>
    )
  }
}


export default class SiteWrapper extends React.Component {
  componentDidMount() {

  }

  render() {
    return (
      <section id={f.phraseToId(this.props.id, false)}>
        <h2>{this.props.id}</h2>
        <div className='site-wrapper'>
          <Site
            name='If Null True'
            developers={['kElnaDev']}
            urls={[['https://ifnulltrue.com', 'https://int.oggyp.com']]}
          />
        </div>
      </section>
    )
  }
}
